import React from "react";
import Layout from "../components/layout";

const ClassSchedule = () => {
  return (
    <React.Fragment>
      <Layout>
        <h1>Class Schedule Page</h1>
      </Layout>
    </React.Fragment>
  );
};

export default ClassSchedule;
